import {
  Typography,
  Box,
  createTheme,
  ThemeProvider,
  Container,
  Grid,
} from "@mui/material";
import Header from "../Components/Header";
import image1 from "./griffithBeherit.png";

const customTheme = createTheme({
  palette: {
    primary: { main: "#393646" },
    secondary: { main: "#4F4557" },
    background: { default: "#F4EEE0" },
    text: { primary: "#6D5D6E" },
  },
});

const Home = () => {
  return (
    <ThemeProvider theme={customTheme}>
      <Container disableGutters sx={{ minWidth: "100%", minHeight: "100vh" }}>
        <Grid
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
        >
          <Grid item sx={{ width: "100%" }}>
            <Header />
          </Grid>
          <Grid
            container
            direction="column"
            justifyContent="center"
            alignItems="center"
            width="100%"
            height="50hv"
          >
            <Box
              component="img"
              sx={{
                height: "100%",
                width: "100%",
                maxHeight: { xs: "100%", md: "100%" },
                maxWidth: { xs: "100%", md: "100%" },
              }}
              alt="an image"
              src={image1}
            />
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
};

export default Home;
